declare(strict_types=1);

namespace phpOMS\tests\Utils;

require_once __DIR__ . '/../Autoloader.php';

use phpOMS\Utils\ImageUtils;

/**
 * @testdox phpOMS\tests\Utils\ImageUtilsTest: Image utilities
 *
 * @internal
 */
final class ImageUtilsTest extends \PHPUnit\Framework\TestCase
{
    public function testLightness() : void
    {
        self::assertEquals(0.0, ImageUtils::lightness(0));
        self::assertEquals(1.0, ImageUtils::lightness(16777215));
    }

    public function testLightnessFromRgb() : void
    {
        self::assertEquals(0.0, ImageUtils::lightnessFromRgb(0, 0, 0));
        self::assertEquals(1.0, ImageUtils::lightnessFromRgb(255, 255, 255));
    }

    public function testResize() : void
    {
        ImageUtils::resize(__DIR__ . '/img/logo.png', __DIR__ . '/img/logo_resized.png', 256, 256);
        self::assertTrue(\is_file(__DIR__ . '/img/logo_resized.png'));
    }

    public function testDifference() : void
    {
        foreach (['png', 'gif'] as $type) {
            $diff = ImageUtils::difference(__DIR__ . '/img/img1.' . $type, __DIR__ . '/img/img2.' . $type, __DIR__ . '/img/diff1.' . $type, 0);
            $diff = ImageUtils::difference(__DIR__ . '/img/img1.' . $type, __DIR__ . '/img/img2.' . $type, __DIR__ . '/img/diff2.' . $type, 1);

            self::assertGreaterThan(0, $diff);
        }
    }

    /**
     * @testdox Base64 image data can be decoded to an image
     * @covers phpOMS\Utils\ImageUtils
     * @group framework
     */
    public function testImage() : void
    {
        self::assertEquals(
            \file_get_contents(__DIR__ . '/img/logo.png'),
            ImageUtils::decodeBase64Image(
                'data:image/png;base64,'
            )
        );
    }
}
